import React from 'react'
import './Task.css'

function Tasks(props) {
    //console.log(JSON.stringify(props));
    return (
        <div className="column" onClick={() => props.handleShow(props.id)}>
            <div className="card">

                <h1>{props.Task_type}</h1>
                <h3>{props.Tittle}</h3>
                <p>{props.Description}</p>
                <p>{props.Date}</p>
            </div>
        </div>
    )
}

export default Tasks
